import{_ as s,a as e,b as t}from"./chunks/flutter-mix-android-run-configs.c01843f6.js";import{_ as o}from"./chunks/flutter-mix-update-dtos-ide.5c8f3d44.js";import{_ as p,o as c,c as l,d as n,b as a,a as r}from"./app.2aea72c0.js";var i="/assets/flutter-mix-windows-todo.609afe3a.png";const A='{"title":"Flutter Mix Template","description":"","frontmatter":{"slug":"flutter-mix","title":"Flutter Mix Template"},"headers":[{"level":2,"title":"Pre-requisites","slug":"pre-requisites"},{"level":2,"title":"New or Existing Project","slug":"new-or-existing-project"},{"level":2,"title":"Project Structure","slug":"project-structure"},{"level":2,"title":"Running","slug":"running"},{"level":3,"title":"ServiceStack App","slug":"servicestack-app"},{"level":3,"title":"Flutter App","slug":"flutter-app"},{"level":2,"title":"Development","slug":"development"},{"level":3,"title":"Flutter main.dart","slug":"flutter-main-dart"},{"level":3,"title":"Flutter Template Overview","slug":"flutter-template-overview"},{"level":3,"title":"Calling the Hello API","slug":"calling-the-hello-api"},{"level":3,"title":"Updating your client DTOs","slug":"updating-your-client-dtos"},{"level":3,"title":"Questions?","slug":"questions"}],"relativePath":"flutter-mix.md"}',u={},d=n("p",null,[a("Two mix templates to help you build services with Flutter clients are the "),n("code",null,"flutter"),a(" and "),n("code",null,"flutter-grpc"),a(" mix templates.")],-1),k=n("p",null,[a("In this walk through we will be focusing on "),n("code",null,"mix flutter"),a(" template. See "),n("a",{href:"./flutter-grpc-mix.html"},[a("here for details on "),n("code",null,"mix flutter-grpc")]),a(".")],-1),h=n("iframe",{class:"video-hd",src:"https://www.youtube.com/embed/t4WcXo4Vnio",frameborder:"0",allow:"autoplay; encrypted-media",allowfullscreen:""},null,-1),m=r(`<p>These templates create a new Flutter application using your locally installed <a href="https://docs.flutter.dev/get-started/install" target="_blank" rel="noopener noreferrer">Flutter SDK</a> that comes wired up to the ServiceStack project template it is mixed into.</p><p>These mix templates can be added to ServiceStack templated projects using the <a href="./dotnet-tool.html">ServiceStack dotnet x tool</a>, which can be installed using the command:</p><div class="language-bash"><pre><code>$ dotnet tool <span class="token function">install</span> <span class="token parameter variable">--global</span> x 
</code></pre></div><h2 id="pre-requisites" tabindex="-1">Pre-requisites <a class="header-anchor" href="#pre-requisites" aria-hidden="true">#</a></h2><ul><li>Flutter SDK</li><li>Dart SDK</li><li>ServiceStack dotnet x tool</li></ul><p><img src="`+s+`" alt=""></p><h2 id="new-or-existing-project" tabindex="-1">New or Existing Project <a class="header-anchor" href="#new-or-existing-project" aria-hidden="true">#</a></h2><p>The Flutter integration works with most ServiceStack templates. It does make the assumption that when working locally, the initial Flutter application will connect to the ServiceStack host via <code>localhost:5001</code> or if the client is running on an Android Emulator, <code>10.0.0.2:5001</code>.</p><p>For example, you could <a href="./dotnet-new.html">start with a new</a> <code>web</code> ServiceStack project to host your web services, and add a working Flutter client using the mix template.</p><div class="language-bash"><pre><code>$ x new web MyApp
</code></pre></div><p>Then from your new solution directory <code>MyApp</code>, mix in the Flutter application using:</p><div class="language-bash"><pre><code>$ x mix flutter
</code></pre></div><h2 id="project-structure" tabindex="-1">Project Structure <a class="header-anchor" href="#project-structure" aria-hidden="true">#</a></h2><p>The <code>x mix flutter</code> template uses your locally installed Flutter SDK to create the initial Flutter application via the <code>flutter create</code> command. It then overrides some source files, and adds some required Dart dependencies to facilitate the integration with your web services.</p><p><img src="`+e+`" alt=""></p><h2 id="running" tabindex="-1">Running <a class="header-anchor" href="#running" aria-hidden="true">#</a></h2><p>To develop on your Flutter client, it is best to take advantage of the hot reload functionality of both Flutter and <code>dotnet watch</code>.</p><h3 id="servicestack-app" tabindex="-1">ServiceStack App <a class="header-anchor" href="#servicestack-app" aria-hidden="true">#</a></h3><p>From your <code>web</code> project directory, navigate into your <code>MyApp</code> AppHost directory and run:</p><div class="language-bash"><pre><code>$ dotnet <span class="token function">watch</span>
</code></pre></div><p>Keep your services running, and open your <code>myapp_flutter</code> directory using <a href="https://developer.android.com/studio/install" target="_blank" rel="noopener noreferrer">Android Studio</a>.</p><h3 id="flutter-app" tabindex="-1">Flutter App <a class="header-anchor" href="#flutter-app" aria-hidden="true">#</a></h3><p>When building application in flutter, you can use various <a href="https://docs.flutter.dev/get-started/editor?tab=androidstudio" target="_blank" rel="noopener noreferrer">IDEs or editors</a>, but in this example we will be using Android Studio. Flutter applications are written in the <a href="https://dart.dev/overview" target="_blank" rel="noopener noreferrer">Dart Language</a>, and since both are developed by Google, there are great resources for <a href="https://dart.dev/guides" target="_blank" rel="noopener noreferrer">learning both the Dart Language</a>, and the <a href="https://docs.flutter.dev/reference/tutorials" target="_blank" rel="noopener noreferrer">Flutter Framework</a>, included <a href="https://docs.flutter.dev/get-started/flutter-for/xamarin-forms-devs" target="_blank" rel="noopener noreferrer">dedicated resources for those familiar with Xamarin.Forms</a>.</p><p>When developing on Windows, Android Studio will automatically support <code>web</code> and <code>desktop</code> targets, as well as making it easier to set up and manage Android Emulated devices.</p><p><img src="`+t+`" alt=""></p><h2 id="development" tabindex="-1">Development <a class="header-anchor" href="#development" aria-hidden="true">#</a></h2><p>From Android Studio, you can target multiple platforms including Windows, Web and Android. If you are on Windows, targeting a Windows Desktop application can provide a rapid development cycle as Flutter Hot Reload works well and performs quickly. And since ServiceStack can generate client <a href="http://msdn.microsoft.com/en-us/library/ff649585.aspx" target="_blank" rel="noopener noreferrer">Data Transfer Objects</a> or DTOs, we can have a <a href="./add-servicestack-reference">typed end-to-end service integration</a> when developing Flutter client applications.</p><h3 id="flutter-main-dart" tabindex="-1">Flutter <code>main.dart</code> <a class="header-anchor" href="#flutter-main-dart" aria-hidden="true">#</a></h3><p>The <code>x mix flutter</code> command provides a customized <code>main.dart</code> with a built-in integration of the <code>Hello</code> API service of your local ServiceStack application.</p><p>This uses the <code>servicestack</code> Dart package which contains a supported <a href="./clients-overview">Service Client</a>. To support both web and non-web client targets, a <code>ClientFactory</code> is used with a conditional import of the platform specific service client from <code>servicestack/web_client.dart</code> for web, and <code>servicestack/client.dart</code> for all native platforms.</p><div class="language-dart"><pre><code><span class="token keyword">var</span> baseUrl <span class="token operator">=</span> <span class="token string-literal"><span class="token string">&quot;https://localhost:5001&quot;</span></span><span class="token punctuation">;</span>
<span class="token keyword">var</span> clientOptions <span class="token operator">=</span> <span class="token class-name">ClientOptions</span><span class="token punctuation">(</span>baseUrl<span class="token punctuation">:</span> baseUrl<span class="token punctuation">)</span><span class="token punctuation">;</span>

client <span class="token operator">=</span> <span class="token class-name">ClientFactory</span><span class="token punctuation">.</span><span class="token function">createWith</span><span class="token punctuation">(</span>clientOptions<span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token function">runApp</span><span class="token punctuation">(</span><span class="token keyword">const</span> <span class="token class-name">MyApp</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><p>The use of Android Emulators for local development is catered for by checking if the application is not in release mode, is not a web platform and if it is running on the Android platform.</p><div class="language-dart"><pre><code><span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>kReleaseMode <span class="token operator">&amp;&amp;</span> <span class="token operator">!</span>kIsWeb<span class="token punctuation">)</span> <span class="token punctuation">{</span>
  <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token class-name">Platform</span><span class="token punctuation">.</span>isAndroid<span class="token punctuation">)</span> <span class="token punctuation">{</span>
    clientOptions<span class="token punctuation">.</span>baseUrl <span class="token operator">=</span> <span class="token string-literal"><span class="token string">&quot;https://10.0.2.2:5001&quot;</span></span><span class="token punctuation">;</span>
    clientOptions<span class="token punctuation">.</span>ignoreCertificatesFor<span class="token punctuation">.</span><span class="token function">add</span><span class="token punctuation">(</span>clientOptions<span class="token punctuation">.</span>baseUrl<span class="token punctuation">)</span><span class="token punctuation">;</span>
  <span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre></div><p>This is done since Android Emulators have limited network access, and can only access the ServiceStack application running on the host. Android can only communicate with the host via the <a href="https://developer.android.com/studio/run/emulator-networking" target="_blank" rel="noopener noreferrer">aliased <code>10.0.2.2</code> IP address from the running emulator</a>.</p><h3 id="flutter-template-overview" tabindex="-1">Flutter Template Overview <a class="header-anchor" href="#flutter-template-overview" aria-hidden="true">#</a></h3><p>Flutter applications use <a href="https://docs.flutter.dev/development/ui/widgets-intro" target="_blank" rel="noopener noreferrer"><code>Widgets</code></a> to build everything you see in a Flutter application.</p><blockquote><p>Widgets describe what their view should look like given their current configuration and state. When a widget\u2019s state changes, the widget rebuilds its description, which the framework diffs against the previous description in order to determine the minimal changes needed in the underlying render tree to transition from one state to the next.</p></blockquote><p>The <code>MyApp</code> widget is the entry point of our application, and the <code>MaterialApp</code> to default your Flutter application to use <a href="https://docs.flutter.dev/development/ui/material" target="_blank" rel="noopener noreferrer">Material Design</a> as a style or theme.</p><div class="language-dart"><pre><code><span class="token keyword">class</span> <span class="token class-name">MyApp</span> <span class="token keyword">extends</span> <span class="token class-name">StatelessWidget</span> <span class="token punctuation">{</span>
  <span class="token keyword">const</span> <span class="token class-name">MyApp</span><span class="token punctuation">(</span><span class="token punctuation">{</span><span class="token keyword">super</span><span class="token punctuation">.</span>key<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

  <span class="token comment">// This widget is the root of your application.</span>
  <span class="token metadata function">@override</span>
  <span class="token class-name">Widget</span> <span class="token function">build</span><span class="token punctuation">(</span><span class="token class-name">BuildContext</span> context<span class="token punctuation">)</span> <span class="token punctuation">{</span>
    <span class="token keyword">return</span> <span class="token class-name">MaterialApp</span><span class="token punctuation">(</span>
      title<span class="token punctuation">:</span> <span class="token string-literal"><span class="token string">&#39;Flutter Demo&#39;</span></span><span class="token punctuation">,</span>
      theme<span class="token punctuation">:</span> <span class="token class-name">ThemeData</span><span class="token punctuation">(</span>
        primarySwatch<span class="token punctuation">:</span> <span class="token class-name">Colors</span><span class="token punctuation">.</span>blue<span class="token punctuation">,</span>
      <span class="token punctuation">)</span><span class="token punctuation">,</span>
      home<span class="token punctuation">:</span> <span class="token keyword">const</span> <span class="token class-name">HelloFlutter</span><span class="token punctuation">(</span>title<span class="token punctuation">:</span> <span class="token string-literal"><span class="token string">&#39;Flutter Demo Home Page&#39;</span></span><span class="token punctuation">)</span><span class="token punctuation">,</span> <span class="token comment">// Your app starts here</span>
    <span class="token punctuation">)</span><span class="token punctuation">;</span>
  <span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre></div><p>The <code>HelloFlutter</code> widget is a <a href="https://api.flutter.dev/flutter/widgets/StatefulWidget-class.html" target="_blank" rel="noopener noreferrer"><code>StatefulWidget</code></a> which references the <code>HelloFlutterState</code> class where the UI is declared and updates are made to the Flutter UI.</p><p>The example application listens for changes from the <code>TextField</code> using a <code>TextEditingController</code>, binding a <code>callService</code> method which fires whenever a change is made.</p><div class="language-dart"><pre><code><span class="token keyword">class</span> <span class="token class-name">HelloFlutterState</span> <span class="token keyword">extends</span> <span class="token class-name">State</span><span class="token generics"><span class="token punctuation">&lt;</span><span class="token class-name">HelloFlutter</span><span class="token punctuation">&gt;</span></span> <span class="token punctuation">{</span>
  <span class="token comment">//State for this widget</span>
  <span class="token class-name">String</span> result <span class="token operator">=</span> <span class="token string-literal"><span class="token string">&quot;&quot;</span></span><span class="token punctuation">;</span>
  <span class="token keyword">var</span> myController <span class="token operator">=</span> <span class="token class-name">TextEditingController</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
  <span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">.</span>

  <span class="token metadata function">@override</span>
  <span class="token keyword">void</span> <span class="token function">initState</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
    <span class="token keyword">super</span><span class="token punctuation">.</span><span class="token function">initState</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token comment">// Listen for changes from the TextField and call our API</span>
    myController<span class="token punctuation">.</span><span class="token function">addListener</span><span class="token punctuation">(</span>callService<span class="token punctuation">)</span><span class="token punctuation">;</span>
  <span class="token punctuation">}</span>
  
  <span class="token keyword">void</span> <span class="token function">callService</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token keyword">async</span> <span class="token punctuation">{</span>
    <span class="token keyword">var</span> text <span class="token operator">=</span> myController<span class="token punctuation">.</span>text<span class="token punctuation">.</span>isEmpty <span class="token operator">?</span> <span class="token string-literal"><span class="token string">&quot;World&quot;</span></span> <span class="token punctuation">:</span> myController<span class="token punctuation">.</span>text<span class="token punctuation">;</span>
    <span class="token keyword">var</span> response <span class="token operator">=</span> <span class="token keyword">await</span> client<span class="token punctuation">.</span><span class="token keyword">get</span><span class="token punctuation">(</span><span class="token class-name">Hello</span><span class="token punctuation">(</span>name<span class="token punctuation">:</span> text<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token function">setState</span><span class="token punctuation">(</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
      result <span class="token operator">=</span> response<span class="token punctuation">.</span>result<span class="token operator">!</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
  <span class="token punctuation">}</span>
  
<span class="token metadata function">@override</span>
  <span class="token class-name">Widget</span> <span class="token function">build</span><span class="token punctuation">(</span><span class="token class-name">BuildContext</span> context<span class="token punctuation">)</span> <span class="token punctuation">{</span>
    <span class="token keyword">return</span> <span class="token class-name">Scaffold</span><span class="token punctuation">(</span><span class="token comment">//...</span>
      body<span class="token punctuation">:</span> <span class="token class-name">Center</span><span class="token punctuation">(</span><span class="token comment">//..</span>
        <span class="token class-name">TextField</span><span class="token punctuation">(</span><span class="token comment">//..</span>
          controller<span class="token punctuation">:</span> myController<span class="token punctuation">,</span>
      <span class="token punctuation">)</span>
</code></pre></div><h3 id="calling-the-hello-api" tabindex="-1">Calling the Hello API <a class="header-anchor" href="#calling-the-hello-api" aria-hidden="true">#</a></h3><p>The <code>callService</code> method is an <code>async</code> method where Dart has a familiar syntax to dotnet. The generated Request and Response DTOs located in the <code>dtos.dart</code> file represent the same messages on our ServiceStack server, so we also get similar syntax and types when compared to calling from a dotnet client.</p><div class="language-dart"><pre><code>  <span class="token keyword">void</span> <span class="token function">callService</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token keyword">async</span> <span class="token punctuation">{</span>
    <span class="token keyword">var</span> text <span class="token operator">=</span> myController<span class="token punctuation">.</span>text<span class="token punctuation">.</span>isEmpty <span class="token operator">?</span> <span class="token string-literal"><span class="token string">&quot;World&quot;</span></span> <span class="token punctuation">:</span> myController<span class="token punctuation">.</span>text<span class="token punctuation">;</span>
    <span class="token keyword">var</span> response <span class="token operator">=</span> <span class="token keyword">await</span> client<span class="token punctuation">.</span><span class="token keyword">get</span><span class="token punctuation">(</span><span class="token class-name">Hello</span><span class="token punctuation">(</span>name<span class="token punctuation">:</span> text<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// response of type \`HelloResponse\`.</span>
    <span class="token function">setState</span><span class="token punctuation">(</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
      result <span class="token operator">=</span> response<span class="token punctuation">.</span>result<span class="token operator">!</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
  <span class="token punctuation">}</span>
</code></pre></div><h3 id="updating-your-client-dtos" tabindex="-1">Updating your client DTOs <a class="header-anchor" href="#updating-your-client-dtos" aria-hidden="true">#</a></h3><p>During development of your web services, when changes are made to your Request DTO classes, your client sometimes needs to be aware of these changes. Your client DTOs in the <code>lib/dtos.dart</code> file can be regenerated while your ServiceStack application is running by using the Servicestack dotnet x tool:</p><div class="language-bash"><pre><code>$ x dart
</code></pre></div><p>If you use Android Studio, there is also a ServiceStack IDEA Plugin for Jetbrains IDEs that can make it easy to quickly update your client DTOs.</p><p><img src="`+o+`" alt=""></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>To install the Plugin goto <code>Settings</code>-&gt;<code>Plugins</code>-&gt;Search Marketplace for <code>ServiceStack</code>.</p></div><p>The <code>dtos.dart</code> file that comes with the Flutter <code>mix</code> template only contains DTOs for the default Hello service, but if other web services are running on your host application, updating your <code>dtos.dart</code> file using one of the above methods will then sync your client and server Request DTOs.</p><p>For example, if you use one of our <a href="https://jamstacks.net" target="_blank" rel="noopener noreferrer">Jamstack templates</a>, there is also a Todo service.</p><p>Running <code>x dart</code> in project terminal will update our DTOs, and we can query for <code>Todo</code> items using the following Dart syntax.</p><div class="language-dart"><pre><code><span class="token class-name">Future</span><span class="token generics"><span class="token punctuation">&lt;</span><span class="token class-name">QueryResponse</span><span class="token punctuation">&lt;</span><span class="token class-name">Todo</span><span class="token punctuation">&gt;</span><span class="token punctuation">&gt;</span></span> <span class="token function">queryTodos</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token keyword">async</span> <span class="token punctuation">{</span>
    <span class="token keyword">return</span> <span class="token keyword">await</span> client<span class="token punctuation">.</span><span class="token keyword">get</span><span class="token punctuation">(</span><span class="token class-name">QueryTodos</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>
</code></pre></div><p>The <code>Todo</code> is a shared model type, so we can use them in our application passing around the same data structure.</p><div class="language-dart"><pre><code><span class="token class-name">Future</span><span class="token generics"><span class="token punctuation">&lt;</span><span class="token class-name">Todo</span><span class="token punctuation">&gt;</span></span> <span class="token function">updateTodo</span><span class="token punctuation">(</span><span class="token class-name">Todo</span> item<span class="token punctuation">)</span> <span class="token keyword">async</span> <span class="token punctuation">{</span>
    <span class="token keyword">return</span> <span class="token keyword">await</span> client<span class="token punctuation">.</span><span class="token function">put</span><span class="token punctuation">(</span><span class="token class-name">UpdateTodo</span><span class="token punctuation">(</span>
        id<span class="token punctuation">:</span> item<span class="token punctuation">.</span>id<span class="token punctuation">,</span>
        isFinished<span class="token punctuation">:</span> <span class="token punctuation">(</span>item<span class="token punctuation">.</span>isFinished <span class="token operator">?</span><span class="token operator">?</span> <span class="token boolean">false</span><span class="token punctuation">)</span> <span class="token operator">?</span> <span class="token boolean">true</span> <span class="token punctuation">:</span> <span class="token boolean">false</span><span class="token punctuation">,</span>
        text<span class="token punctuation">:</span> item<span class="token punctuation">.</span>text<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>
</code></pre></div><p>We&#39;ve made an example codebase called <a href="https://github.com/NetCoreApps/BookingsFlutter" target="_blank" rel="noopener noreferrer">BookingsFlutter</a> to show a more featured cross-platform application integrating with different types of services.</p><p><a href="https://github.com/NetCoreApps/BookingsFlutter" target="_blank" rel="noopener noreferrer"><img src="`+i+'" alt=""></a></p><h3 id="questions" tabindex="-1">Questions? <a class="header-anchor" href="#questions" aria-hidden="true">#</a></h3><p>Head over to our <a href="https://forums.servicestack.net" target="_blank" rel="noopener noreferrer">Customer Forums</a> or <a href="https://servicestack.net/ask" target="_blank" rel="noopener noreferrer">GitHub Discussions</a> if you are having issues or have any questions!</p>',61),g=[d,k,h,m];function f(v,w,y,b,x,S){return c(),l("div",null,g)}var D=p(u,[["render",f]]);export{A as __pageData,D as default};
